
class Solution:
    def corpFlightBookings(self, bookings, n):

        seats = [0 for i in range(n+1)]

        for i,j,k in bookings:

            seats[i-1] += k
            seats[j] -= k

        f = 0
        for z in range(n+1):
            seats[z] += f
            f = seats[z]



        return seats[:-1]



bookings = [[1,2,10],[2,3,20],[2,5,25]]
n = 5

c = Solution().corpFlightBookings(bookings, n)
print(c)


